import './index.css';
import NavigationBar from './components/NavigationBar';
import Home from './Pages/Home';
import Projects from './Pages/Projects';
import About from './Pages/About';
import Contact from './Pages/Contact';
import RunningTracker from './Pages/RunningTracker'
import DataScience from './Pages/DataScience'
import ComputerVision from './Pages/ComputerVision'
import { AnimatedSwitch } from 'react-router-transition';
import { Route, Routes, Switch, useLocation } from 'react-router-dom';
import {NextUIProvider} from "@nextui-org/react";

export default function App() {
  let location = useLocation;

  return (
    <NextUIProvider>
    <div className='bg-gray-true-100'>
      <NavigationBar />
      <div>
        <TransitionGroup>
          <CSSTransition
            key={location.pathname}
            classNames="fade"
            timeout={300}
            >
            <Routes>
              <Route path='/' element={<Home />} />
              <Route path='/Projects' element={<Projects />} />
              <Route path='/About' element={<About />} />
              <Route path='/Contact' element={<Contact />} />
              <Route path='/RunningTracker' element={<RunningTracker />} />
              <Route path='/ComputerVision' element={<ComputerVision />} />
              <Route path='/DataScience' element={<DataScience />} />
            </Routes>
          </CSSTransition>
        </TransitionGroup>
      </div>
    </div>
    </NextUIProvider>
  );
}
